import React, { Component } from 'react';
import Layout from './Layout';
import Header from './Header';

export default class index extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <Layout>
        <Header />
      </Layout>
    );
  }
}
